import "./BoxLHS.css";
import Pic from "./LoginImg/LHSimages.jpg"

const BoxLHS = () => {
    return(
        <div className="BoxLHSBody">
            <img className="card-bg tc dib br3 pa3 ma2 grow bw2 shadow-5" style={{backgroundImage : `url(${Pic})`}}/>
        </div>
    );
}

export default BoxLHS;
